import React, { useState } from "react";
import "./ResourcePage.css";

const categories = [
  "Academic",
  "Financial",
  "Career",
  "Health",
  "Social",
  "Student-submitted",
];

const initialResources = [
  {
    id: 1,
    category: "Academic",
    title: "Library Services",
    description:
      "Access to extensive academic databases and research materials",
  },
  {
    id: 2,
    category: "Financial",
    title: "Scholarship Database",
    description: "Comprehensive list of available scholarships and grants",
  },
  {
    id: 3,
    category: "Career",
    title: "Resume Workshop",
    description: "Learn how to create a standout resume for job applications",
  },
  {
    id: 4,
    category: "Health",
    title: "Counseling Services",
    description: "Free mental health support for all students",
  },
  {
    id: 5,
    category: "Social",
    title: "Student Clubs Directory",
    description: "Find and join student-run organizations on campus",
  },
];

function ResourcePage() {
  const [activeCategory, setActiveCategory] = useState("Social");
  const [searchTerm, setSearchTerm] = useState("");
  const [resources, setResources] = useState(initialResources);
  const [isDialogOpen, setIsDialogOpen] = useState(false);
  const [newResource, setNewResource] = useState({
    title: "",
    description: "",
    category: "",
  });

  const filteredResources = resources.filter(
    (resource) =>
      (resource.category === activeCategory ||
        activeCategory === "Student-submitted") &&
      (resource.title.toLowerCase().includes(searchTerm.toLowerCase()) ||
        resource.description.toLowerCase().includes(searchTerm.toLowerCase()))
  );

  const handleSubmit = (e) => {
    e.preventDefault();
    if (newResource.title && newResource.description && newResource.category) {
      setResources([
        ...resources,
        { ...newResource, id: resources.length + 1 },
      ]);
      setNewResource({ title: "", description: "", category: "" });
      setIsDialogOpen(false);
    }
  };

  return (
    <div className="resource-page">
      <main>
        <div className="left-column">
          <h1>JumpStart</h1>
          <p className="subtitle">
            Explore our wide range of student resources to support your academic
            and personal goals.
          </p>
        </div>

        <div className="center-column">
          <div className="search-container">
            <input
              type="text"
              placeholder="Search resources..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <button className="search-button">🔍</button>
          </div>

          <div className="categories">
            {categories.map((category) => (
              <button
                key={category}
                className={`category-btn ${
                  activeCategory === category ? "active" : ""
                }`}
                onClick={() => setActiveCategory(category)}
              >
                {category}
              </button>
            ))}
          </div>
        </div>

        <div className="right-column">
          {filteredResources.map((resource) => (
            <div key={resource.id} className="resource-card">
              <h2>{resource.title}</h2>
              <p>{resource.description}</p>
              <button className="btn btn-primary">Learn More</button>
            </div>
          ))}
          <button
            className="btn btn-primary btn-large"
            onClick={() => setIsDialogOpen(true)}
          >
            Submit a Resource
          </button>
        </div>
      </main>

      {isDialogOpen && (
        <div className="dialog-overlay">
          <div className="dialog">
            <h2>Submit a New Resource</h2>
            <form onSubmit={handleSubmit}>
              <input
                type="text"
                placeholder="Resource Title"
                value={newResource.title}
                onChange={(e) =>
                  setNewResource({ ...newResource, title: e.target.value })
                }
                required
              />
              <textarea
                placeholder="Description"
                value={newResource.description}
                onChange={(e) =>
                  setNewResource({
                    ...newResource,
                    description: e.target.value,
                  })
                }
                required
              />
              <select
                value={newResource.category}
                onChange={(e) =>
                  setNewResource({ ...newResource, category: e.target.value })
                }
                required
              >
                <option value="">Select a category</option>
                {categories.map((category) => (
                  <option key={category} value={category}>
                    {category}
                  </option>
                ))}
              </select>
              <button type="submit" className="btn btn-primary">
                Submit Resource
              </button>
              <button
                type="button"
                className="btn"
                onClick={() => setIsDialogOpen(false)}
              >
                Cancel
              </button>
            </form>
          </div>
        </div>
      )}
    </div>
  );
}

export default ResourcePage;
